import React, { useEffect, useState } from 'react';
import axios from 'axios';
import NavBar from '../components/NavBar';
import DatePicker from 'react-datepicker';
import { ko } from 'date-fns/locale';
import { saveAs } from 'file-saver';
import 'react-datepicker/dist/react-datepicker.css';
import './css/admin.css';
import './css/main.css';

const BASE_URL = process.env.REACT_APP_BASE_URL;
const PAGE_SIZE = 10;

export default function UserLogsPage() {
  const [logs, setLogs] = useState([]);
  const [totalLogs, setTotalLogs] = useState(0);
  const [currentPage, setCurrentPage] = useState(1);
  const [searchEmail, setSearchEmail] = useState('');
  const [statusFilter, setStatusFilter] = useState('ALL');
  const [startDate, setStartDate] = useState(null);
  const [endDate, setEndDate] = useState(null);

  const fetchLogs = async (page) => {
    try {
      const res = await axios.get(`${BASE_URL}/users/admin/logs?page=${page}&size=${PAGE_SIZE}`, {
        withCredentials: true,
      });
      setLogs(res.data.logs || []);
      setTotalLogs(res.data.total || 0);
    } catch (err) {
      console.error('❌ 로그 불러오기 실패:', err);
    }
  };

  useEffect(() => {
    fetchLogs(currentPage);
  }, [currentPage]);

  // 🔍 필터링
  const filteredLogs = logs.filter(log => {
    const emailMatch = log.email?.toLowerCase().includes(searchEmail.toLowerCase());
    const statusMatch = statusFilter === 'ALL' || log.status === statusFilter;
    const date = new Date(log.timestamp);
    const dateMatch =
      (!startDate || date >= startDate) &&
      (!endDate || date <= endDate);
    return emailMatch && statusMatch && dateMatch;
  });

  const totalPages = Math.ceil(totalLogs / PAGE_SIZE);

  // 📥 CSV 다운로드
  const handleDownloadCSV = () => {
    const header = "ID,Email,IP,Timestamp,Type,Status\n";
    const csv = filteredLogs.map(log =>
      `${log.id},"${log.email}",${log.ip},${log.timestamp},${log.type},${log.status}`
    ).join("\n");

    const blob = new Blob([header + csv], { type: "text/csv;charset=utf-8" });
    saveAs(blob, "user_logs.csv");
  };

  return (
    <>
      <NavBar />
      <div className="admin-wrapper">
        <div className="admin-inner">
          <h2 className="section-title">사용자 로그 조회</h2>

          <div className="search-row">
            <input
              type="text"
              className="search-input"
              placeholder="이메일 검색"
              value={searchEmail}
              onChange={(e) => setSearchEmail(e.target.value)}
            />

            <select
              className="dropdown-select"
              value={statusFilter}
              onChange={(e) => setStatusFilter(e.target.value)}
            >
              <option value="ALL">전체</option>
              <option value="SUCCESS">성공</option>
              <option value="FAIL">실패</option>
            </select>

            <DatePicker
              selected={startDate}
              onChange={(date) => setStartDate(date)}
              placeholderText="시작일"
              dateFormat="yyyy-MM-dd"
              locale={ko}
              className="date-picker"
            />

            <DatePicker
              selected={endDate}
              onChange={(date) => setEndDate(date)}
              placeholderText="종료일"
              dateFormat="yyyy-MM-dd"
              locale={ko}
              className="date-picker"
            />

            <button onClick={handleDownloadCSV} className="btn download-btn">
              📥 CSV 다운로드
            </button>
          </div>

          <table className="admin-table">
            <thead>
              <tr>
                <th>ID</th>
                <th>이메일</th>
                <th>IP</th>
                <th>일시</th>
                <th>유형</th>
                <th>상태</th>
              </tr>
            </thead>
            <tbody>
              {filteredLogs.map((log) => (
                <tr key={log.id}>
                  <td>{log.id}</td>
                  <td>{log.email}</td>
                  <td>{log.ip}</td>
                  <td>{log.timestamp}</td>
                  <td>{log.type}</td>
                  <td>{log.status}</td>
                </tr>
              ))}
            </tbody>
          </table>

          <div className="pagination">
            {[...Array(totalPages)].map((_, i) => (
              <button
                key={i}
                className={`page-button ${currentPage === i + 1 ? 'active' : ''}`}
                onClick={() => setCurrentPage(i + 1)}
              >
                {i + 1}
              </button>
            ))}
          </div>
        </div>
      </div>
    </>
  );
}
